import React from 'react'
import AliceCarousel from 'react-alice-carousel'
import 'react-alice-carousel/lib/alice-carousel.css'

import NSA from "../../pages/images/nsaBuild.jpg";
import doctor from "../../pages/images/doctor.jpg";
import trivia from "../../pages/images/triviaChuck.jpg";
import biohazzard from "../../pages/images/biohazzard.jpg";
import claws from "../../pages/images/claws.jpg";

 function Slides2() {
const Gallery = () => {
  const handleOnDragStart = (e) => e.preventDefault()
  return (
    <AliceCarousel mouseTrackingEnabled>
      <img src={NSA} onDragStart={handleOnDragStart} className="yours-custom-class" />
      <img src={doctor} onDragStart={handleOnDragStart} className="yours-custom-class" />
      <img src={trivia} onDragStart={handleOnDragStart} className="yours-custom-class" />
      <img src={biohazzard} onDragStart={handleOnDragStart} className="yours-custom-class" />
      <img src={claws} onDragStart={handleOnDragStart} className="yours-custom-class" />
    </AliceCarousel>
  )
}
}

export default Slides2;
